import React, { Component } from "react";
import styled from "styled-components";

const HEADER_HEIGHT = 100;

const Title = styled.h1`
  display: flex;
  color: black;
  justify-content: center;
  align-items: center;
  font-size: 15px;
`;

const Logo = styled.img`
  display: block;
  width: 100%;
  box-shadow: -1px 0px 0px rgba(0, 0, 0, 0.06);
  object-fit: cover;
`;

const Container = styled.div`
  margin: 10px;
  display: grid;
  grid-template-columns: ${HEADER_HEIGHT}px repeat(auto-fit, minmax(10px, 1fr));
  height: ${HEADER_HEIGHT};
  justify-content: center;
  text-align: center;
  overflow: hidden;
  background-color: #666;
  color: white;
`;

const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

export default class Header extends Component {
  render() {
    return (
      <Container>
        <Logo src={`https://picsum.photos/${HEADER_HEIGHT}`} />

        <Title>Bine ai venit pe edics.ro</Title>
        <Title>Solutii inteligente la problemele tale</Title>

      </Container>
    );
  }
}
